mapper.select:
select 

from TRSDET_HISTORY
where AMENDMENT_NO = #{AMENDMENT_NO}
  and BRANCH_CODE = #{BRANCH_CODE}
  and COMP_CODE = #{COMP_CODE}
  and DEAL_IND = #{DEAL_IND}
  and FUND_LINE_NO = #{FUND_LINE_NO}
  and LINE_NO = #{LINE_NO}
  and SERIAL_NO = #{SERIAL_NO}

mapper.delete:
delete from TRSDET_HISTORY
where AMENDMENT_NO = #{AMENDMENT_NO}
  and BRANCH_CODE = #{BRANCH_CODE}
  and COMP_CODE = #{COMP_CODE}
  and DEAL_IND = #{DEAL_IND}
  and FUND_LINE_NO = #{FUND_LINE_NO}
  and LINE_NO = #{LINE_NO}
  and SERIAL_NO = #{SERIAL_NO}
